import React from 'react';

function Blog() {
  return (
    <article className="blog-section">
      <h2>Blog</h2>
      <div className="blog-grid">
        {/* Tambahkan artikel blog Anda di sini */}
        <div className="blog-item">
          <h4>Pengalaman Belajar React.js</h4>
          <p>Cerita perjalanan belajar React.js di ID CAMP 2024</p>
        </div>
      </div>
    </article>
  );
}

export default Blog;
